Protocol name : /ipfs/id/1.0.0 Note : This protocol is identical to the identify protocol of the libp2p library. After the protocol has been negotiated on a substream, the receiving side of the substream sends back its identification information. The identification information is the encoding of the following protobuf definition: syntax = "proto2";
message Identify { optional string protocolVersion = 5; optional string agentVersion = 6; optional bytes publicKey = 1; repeated bytes listenAddrs = 2; optional bytes observedAddr = 4; repeated string protocols = 3;
} The side that opened the substream can close its writing side either before or after receiving the response, at its discretion. TODO finish
